INSERT INTO `taobao_article` (`id`, `title`, `content`, `create_time`, `username`) VALUES
(6, '阿里与腾讯火拼O2O布局，百度仍不急？', '&lt;p&gt;&lt;span style=&quot;color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px; white-space: normal; &quot;&gt;&amp;nbsp; &amp;nbsp; 兔兔评论：随着BAT的落子的增多，O2O产业链雏形已&lt;span style=&quot;color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px; white-space: normal; &quot;&gt;在公众视野中&lt;/span&gt;完整的呈现，“入口+服务+支付”为O2O的主要框架，BAT正在围绕这一框架来丰富O2O的产业链布局。BAT的三国大战将在很长一段时间内处于相持阶段，而这个实力竞争的最终结局也极有可能就是未来的O2O产业链格局。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px; white-space: normal; &quot;&gt;&lt;img src=&quot;file:///d:/PROGRA~1/360se6/USERDA~1/Temp/F235A8~1.JPG&quot;/&gt;&lt;img src=&quot;http://y2.ifengimg.com/haina/2014_30/f235a8c64d05270.jpg&quot; _src=&quot;http://y2.ifengimg.com/haina/2014_30/f235a8c64d05270.jpg&quot;/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px; white-space: normal; &quot;&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;7月18日，阿里宣布正式完成高德私有化进程，并称将开始与阿里各项业务进行全面整合。高德私有化完成意味着阿里O2O更进一步，接下来围绕高德的O2O项目可以顺利推进了。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;过去1年时间，BAT三巨头都在围绕O2O做布局，尤其阿里和腾讯更为积极，近期阿里先后合并UC，私有化高德，而腾讯投资了58同城，O2O市场竞争俨然已经成为巨头们的游戏。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;随着巨头们的落子逐渐增多，O2O产业链雏形已完整的呈现在公众视野，“入口+服务+支付”为O2O的主要框架，巨头们正在围绕这一框架来丰富O2O的产业链布局。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;业界舆论有关BAT三巨头的O2O布局分析层出不穷比比皆是，而最终结论各有偏向，当然每个读者心中也有自己支持的巨头，然而对于大多数看热闹的普通大众来讲，谁的布局看起来更高大上不要紧，切实可用才是最重要的。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;鉴于围绕BAT的O2O布局已有各类版本，重复的内容这就不做复述了，我们仅探讨下各家的最新动态。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;&lt;strong&gt;阿里：合并UC，私有化高德，增强O2O入口实力&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;近期，对于阿里在O2O市场布局可谓喜事连连，先是合并UC，随后又完成高德私有化进程，这让阿里切切实实的又掌控了两大O2O入口。在此前的巨头O2O博弈中，阿里对O2O入口的把控能力经常被诟病，彼时手机淘宝和支付宝钱包是阿里唯一能拿得出手的可称为O2O入口的两大产品。然而，手机淘宝的网购属性太过强大以至于让用户忽视了其上的O2O服务，而支付宝钱包能又因其支付工具特点能提供的O2O服务项目有限。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;在投资UC和高德之后，业界对阿里的O2O入口的竞争力有了更多的期待，不过，仅仅作为投资方，阿里并不能干预指挥UC和高德的发展，更难以将自身的业务优势进行整合，所以也就有了今天合并UC、收购高德的最终结果，因为阿里清楚UC和高德对O2O入口的意义重大。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;UC作为移动互联网的入口，同时更是O2O的重要入口，O2O发展困境之一就是因众多生活服务难以标准化，而浏览器产品最大特点是能承载各式各样的使用需求。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;对于餐饮、酒店、娱乐、门票、交通等LBS服务，高德地图则是阿里选定的最佳入口。另外，现如今UC、高德同属阿里旗下，UC的泛入口能力，将补充高德在WAP端地图市场的弱势。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;各位是否对UC+高德的组合有些似曾相识的熟悉感，没错，与百度的O2O入口组合别无二致。UC作为最大的手机浏览器，旗下移动搜索“神马”市场渗透率已经突破20%，活跃用户1亿，位于市场第二，目前正与百度在移动端焦灼竞争，而高德地图则与百度地图更是处在伯仲之间。如此看来，阿里用了不到50亿&lt;a href=&quot;http://app.finance.ifeng.com/hq/rmb/quote.php?symbol=USD&quot; target=&quot;_blank&quot; style=&quot;color: rgb(0, 66, 118); font-weight: bold; &quot;&gt;美元&lt;/a&gt;的价格就收下了可与百度O2O入口势均力敌两大入口级产品。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;手机淘宝、支付宝钱包、UC、高德这四款产品已让阿里牢牢掌控了四大O2O入口，这四款产品交叉覆盖足矣让阿里抢占下一轮竞争的市场先机。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;&lt;strong&gt;腾讯：投资58同城，丰富服务内容建设&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;相比阿里的多重入口，腾讯选择集中火力将微信作为O2O第一入口。虽然旗下还有手Q、&lt;a href=&quot;http://car.auto.ifeng.com/series/1785&quot; target=&quot;_blank&quot; style=&quot;color: rgb(0, 66, 118); font-weight: bold; &quot;&gt;QQ&lt;/a&gt;浏览器、腾讯地图等入口级产品，但在微信的光环下早已黯然失色的沦为附属品。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;一招鲜吃遍天，借着微信的东风，腾讯正在疯狂吹起微信O2O的大旗，试图通过微信连通一切O2O服务，高朋、滴滴、大众点评先后接入微信，近期投资的58同城用不了多久也会接入到微信。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;从腾讯的布局来看，其更为重视服务内容的建设，因自身在电商消费领域的弱势，腾讯不得不采用以投资的方式换得合作伙伴的支持。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;投资引入大众点评入驻后，增强了微信在餐饮、酒店、娱乐等“生活消费”的O2O服务能力。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;近期投资58同城又让腾讯如虎添翼，业界开始对微信租房、维修、保姆、代价等“生活服务”的O2O服务有了新的期待。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;另外，一些如充值、缴费、彩票等“便民服务”的O2O服务项也早已由财付通团队提供到位了。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;不仅如此，腾讯在“本地&lt;a href=&quot;http://travel.ifeng.com/theme/shopping/list_0/0.shtml&quot; target=&quot;_blank&quot; style=&quot;color: rgb(0, 66, 118); font-weight: bold; &quot;&gt;购物&lt;/a&gt;”O2O市场表现也颇为积极，除了收购华南城外，还先后与&lt;a href=&quot;http://finance.ifeng.com/app/hq/stock/sh600859/&quot; target=&quot;_blank&quot; title=&quot;王府井 600859&quot; style=&quot;color: rgb(0, 66, 118); font-weight: bold; &quot;&gt;王府井&lt;/a&gt;&lt;span id=&quot;sh600859_hq&quot;&gt;[&lt;span class=&quot;Ared&quot; style=&quot;color: rgb(255, 0, 0); &quot;&gt;0.13%&lt;/span&gt;&amp;nbsp;&lt;a href=&quot;http://app.finance.ifeng.com/data/stock/tab_zjlx.php?code=sh600859&quot; target=&quot;_blank&quot; style=&quot;color: rgb(0, 66, 118); &quot;&gt;资金&lt;/a&gt;&amp;nbsp;&lt;a href=&quot;http://star.finance.ifeng.com/stock/sh600859&quot; target=&quot;_blank&quot; style=&quot;color: rgb(0, 66, 118); &quot;&gt;研报&lt;/a&gt;]&lt;/span&gt;百货、上品折扣、&lt;a href=&quot;http://finance.ifeng.com/app/hq/stock/sh600628/&quot; target=&quot;_blank&quot; title=&quot;新世界 600628&quot; style=&quot;color: rgb(0, 66, 118); font-weight: bold; &quot;&gt;新世界&lt;/a&gt;&lt;span id=&quot;sh600628_hq&quot;&gt;[0.00%&amp;nbsp;&lt;a href=&quot;http://app.finance.ifeng.com/data/stock/tab_zjlx.php?code=sh600628&quot; target=&quot;_blank&quot; style=&quot;color: rgb(0, 66, 118); &quot;&gt;资金&lt;/a&gt;&amp;nbsp;&lt;a href=&quot;http://star.finance.ifeng.com/stock/sh600628&quot; target=&quot;_blank&quot; style=&quot;color: rgb(0, 66, 118); &quot;&gt;研报&lt;/a&gt;]&lt;/span&gt;百货、天虹百货等线下百货商场进行O2O合作探索。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;目前来看，腾讯在“生活消费”、“生活服务”、“便民服务”、“本地购物”这O2O服务四大分类均有尝试，明显能感受到其对O2O服务内容建设的重视程度。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;腾讯将O2O入口全部压在微信身上是一场充满风险的豪赌，一旦微信热潮褪去，腾讯在O2O市场将会瞬间失控，现在辛辛苦苦的布局O2O服务也将失去意义。失去了入口，内容再多也无人问津。目前手Q的尴尬处境，还是值得腾讯为微信做参考的。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;&lt;strong&gt;百度：“不着急”，求稳不求全&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;相比阿里和腾讯的积极布局，百度则显得淡然了许多，除了全资收购糯米网以外，百度在O2O市场鲜有投资动作。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;百度的O2O入口只有百度搜索和百度地图两个，比不得阿里的多，也比不了腾讯的热;在服务内容上仅仅依赖于糯米，而糯米在团购市场地位暂时又比不了美团、点评;在移动支付市场，阿里的支付宝钱包占据了大半市场份额，而腾讯也在借势微信热度尽全力的推广微信支付，先比来看，百度钱包则显相对落寞了些，一来缺少支付宝的用户基数，二来也没有微信的热度可借势推广。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;百度虽在搜索领域有优势，不过移动搜索市场是一个近乎全新的领域，UC、搜狗、360均对此趋之若鹜，百度在此也还没到像在PC端一样高枕无忧的地步;另一方面，在地图市场，百度与高德难分高下，所以以地图作为O2O入口，百度并不具优势。如今，阿里同时握有UC和高德的控制权，这对百度构成前所未有的威胁。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;“入口+服务+支付”，现在的情况，百度不仅在O2O入口上需要应对阿里的争夺，在服务上同样显得过于单调。当阿里和腾讯都在大肆的拉拢合作伙伴时，百度则集中精力的发展糯米，而且很舍得为糯米烧钱，现在的糯米已深入到三四线市场，这是人人时代不曾想象的发展程度。不过，团购所覆盖的生活消费仅仅是O2O服务中的很小一部分，这或许会影响未来百度O2O的可用性。百度需要重新思考“通过搜索连接服务和人”的战略所产生的隐患。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;百度钱包，可能还有很多人都没听过，支付宝钱包借着支付宝的名号早已众人皆知，而微信支付也因微信而大红大紫了，百度钱包何人在用是个严峻的问题。既缺少支付场景，又缺少用户基础，这让百度钱包的普及之路看起来尤为漫长。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;可能在O2O市场，百度选择求稳不求全，明面上是以搜索+地图为入口，全力做好糯米的服务建设，同时尽可能的推广普及百度钱包，而在暗地里百度更为在意“移动搜索连接人和服务”的战略推进。成为移动搜索王者并成功连接人和服务，O2O自然也就迎刃而解了，所以，暂时稳住一条线就可以了，不贪大求全。对比阿里、腾讯两家，似乎百度的思路更为节能环保了些。&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 25px; padding: 0px; text-indent: 28px; font-size: 14px; color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; line-height: 24px; white-space: normal; &quot;&gt;这两年，围绕BAT O2O布局的分析从未断过，现如今三巨头的布局也基本全部浮水了。各位看官看好谁不重要，三巨头谁胜谁负也不重要，因为O2O正随着科技进步、社会发展而不断演化，过去提到O2O可能只会想到团购，而现在O2O的覆盖面非常广泛，O2O已不该解释为“线上到线下(或者线下到线上)”这么简单了，互联网不断改变着现实生活，应该解释成“网络与现实”相结合。&lt;/p&gt;&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px; white-space: normal; &quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;黑兔兔www.heitutu.com|花兔兔www.huatutu.com&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px; white-space: normal; &quot;&gt;&lt;img src=&quot;file:///d:/PROGRA~1/360se6/USERDA~1/Temp/F235A8~1.JPG&quot;/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px; white-space: normal; &quot;&gt;&lt;img src=&quot;file:///d:/PROGRA~1/360se6/USERDA~1/Temp/F235A8~1.JPG&quot;/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(43, 43, 43); font-family: simsun, arial, helvetica, clean, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px; white-space: normal; &quot;&gt;&lt;img src=&quot;file:///d:/PROGRA~1/360se6/USERDA~1/Temp/F235A8~1.JPG&quot;/&gt;&lt;/span&gt;&lt;/p&gt;', '2014-07-23 01:26:08', 'admin');
